import React from 'react';
import NavbarTop from './NavbarTop';
import lessonincomplete from '../img/lessonincomplete.svg';
import '../App.css';

function Dashboard() {
	return (
		<header>
			<NavbarTop />
			<h2>Dashboard</h2>
			{/* <div style={styles.lessonsElement}></div> */}
			<span style={styles.defaultFontFamily}>
				<img
					src={lessonincomplete}
					style={styles.lessonsElement}
					style={{ display: 'block' }}
				/>
				Lesson 1
			</span>

			<div style={styles.image}>
				<img src={lessonincomplete} />
				<h2 tyle={styles.h2}>
					<span tyle={styles.span}>Lesson 1</span>
				</h2>
			</div>
		</header>
	);
}

const styles = {
	defaultFontFamily: {
		fontFamily: 'din-round, sans-serif'
	},
	lessonsElement: {
		height: '10vmin'
	},
	image: {
		position: 'relative',
		width: '100%'
	},
	h2: {
		position: 'absolute',
		top: '200px',
		left: '0',
		width: '100%'
	},
	span: {
		color: 'white',
		padding: '10px'
	}
};
export default Dashboard;
